import React from 'react';
import './App.css';
import Header from '../components/Header'; // Assuming your App.js is inside the src folder

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* Your custom header content */}
        <h1>The Cassette Deck</h1>
        <nav>
          <ul>
            <li>Home</li>
            <li>Friends</li>
            <li>Profile</li>
          </ul>
        </nav>
      </header>

      {/* Your custom content */}
      <main>
        <p>Welcome to 'The Cassette Deck' social platform.</p>
        {/* Add more content here */}
      </main>
    </div>
  );
}

export default App;
